import React, {Component} from 'react';
import {Container, Row, Col, Input, Button, NavLink, TabPane, Nav, NavItem} from 'reactstrap';
import Navi from "./Navigation";
import TopBar from "./TopBar"; 
import classnames from 'classnames';
export default class MealPlan extends Component {
  constructor(props) {
    super(props);

    this.toggle = this.toggle.bind(this);
    this.state = {
      activeTab: '1'
    };
  }

  toggle(tab) {
    if (this.state.activeTab !== tab) {
      this.setState({ activeTab: tab });
    }
  }
  render() {
    return (     
      <div><TopBar/>        
      <Container>  <br/><br/><br/>
      <Row><Col><h1>Meal Plan</h1></Col></Row>
      <Row><Col><Input type="search" name="search" id="exampleSearch" placeholder="Search" /></Col></Row>
      <Nav tabs>
        <NavItem>
          <NavLink className={classnames({ active: activeTab === '1' })}
            onClick={() => { toggle('1'); }}
          >
            Sunday
          </NavLink>
        </NavItem>
        <NavItem>
          <NavLink className={classnames({ active: activeTab === '2' })}
            onClick={() => { toggle('2'); }}
          >
            Monday
          </NavLink>
        </NavItem>
        <NavItem>
          <NavLink className={classnames({ active: activeTab === '3' })}
            onClick={() => { toggle('3'); }}
          >
            Tuesday
          </NavLink>
        </NavItem>
        <NavItem>
          <NavLink className={classnames({ active: activeTab === '4' })}
            onClick={() => { toggle('4'); }}
          >
            Wednesday
          </NavLink>
        </NavItem>
        <NavItem>
          <NavLink className={classnames({ active: activeTab === '5' })}
            onClick={() => { toggle('5'); }}
          >
            Thursday
          </NavLink>
        </NavItem>
        <NavItem>
          <NavLink className={classnames({ active: activeTab === '6' })}
            onClick={() => { toggle('6'); }}
          >
            Friday
          </NavLink>
        </NavItem>
        <NavItem>
          <NavLink className={classnames({ active: activeTab === '7' })}
            onClick={() => { toggle('7'); }}
          >
            Saturday
          </NavLink>
        </NavItem>
      </Nav>
      <TabContent activeTab={this.state.activeTab}>
        <TabPane tabId="1">

        </TabPane>
        <TabPane tabId="2">
          
        </TabPane>
        <TabPane tabId="3">
          
        </TabPane>
        <TabPane tabId="4">
          
        </TabPane>
        <TabPane tabId="5">
          
        </TabPane>
        <TabPane tabId="6">
          
        </TabPane>
        <TabPane tabId="7">
          
        </TabPane>
      </TabContent>  
      <NavLink href="/mealDay"><Button size="lg">Daily Menu</Button></NavLink>                   
      </Container>
      <Navi/> 
      </div>       
    );
  }
}
